import React from 'react';
import { 
    Row
  } from 'reactstrap';

function CardLayout(props){

  return(
    <Col xs="3">
      <h6 className="p-title">
        {console.log(props)}  {/* World */}
      </h6>
      <Card>
        <CardImg top width="100%" src={props.pic_src} alt={props.alt} />
        <CardBody>
            <CardTitle>{props.props.title}</CardTitle>
            {/* <CardSubtitle>Card subtitle</CardSubtitle> */}
            <CardText>
            {props.text}
          </CardText> 
        </CardBody>
      </Card>
    </Col>
  )
}
export default CardLayout;
